import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Card(){
  <div className="Card">
    <div className="card_detail">
      <img src="https://eloquentjavascript.net/img/cover.jpg" alt="image" className="card_img"/>
        <p className="card_title">Eloquent JavaScript, Second Edition</p>
        <span className="card_author">Marijn Haverbeke</span>
        <a href="http://eloquentjavascript.net/" target="blank">
          <button>Buy Now</button>
        </a>
    </div>    
  </div>

}

ReactDOM.render(
  <React.StrictMode>
        <img src="https://eloquentjavascript.net/img/cover.jpg" alt="image" className="card_img"/>
    <Card/>

  </React.StrictMode>,
  document.getElementById("root")
);
